import React from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import './CSS/Geomap.css'; // Sørg for, at stien er korrekt
import { useLocation } from 'react-router-dom';

function Geomap() {
  const location = useLocation();
  const center = [location.state.lat, location.state.lng]; // Brug lokationen fra state

  return (
    <div className="geomap-screen"> {/* Anvender .geomap-screen klassen her */}
      <MapContainer center={center} zoom={10} style={{ height: "100%", width: "100%" }}>
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        />
        <Marker position={center}>
          <Popup>
            En Sudoku blev løst her!
          </Popup>
        </Marker>
      </MapContainer>
    </div>
  );
}

export default Geomap;
